.field-container {
    .container {
        .border-container {
            background-image: url(data:image/png;base64,);
            // background-color: #e8e6b5;
            border: 2px solid #2E2C1F;
            border-bottom-width: 5px;
            border-right-width: 5px;
            width: 1100px;
            height: 980px;
            z-index: 0;
            position: relative;
            border-radius: 0px;
            box-shadow: 10px 10px 21px 0px rgba(128, 123, 21, 0.7);
            -webkit-box-shadow: 10px 10px 21px 0px rgba(128, 123, 21, 0.7);
            -moz-box-shadow: 10px 10px 21px 0px rgba(128, 123, 21, 0.7);

            ::after {
                content: "";
                position: absolute;
                border: 5px solid #FFFEE0;
                width: 100%;
                height: 100%;
            }
        }
    }
}

.field-container {
    .pic {
        border-radius: 12px;
        width: 192px;
        height: 192px;
        // background: #9C976A;
        outline: 10px double #2E2C1F;
        background: rgb(232, 230, 181);
        background: radial-gradient(circle, rgba(232, 230, 181, 1) 0%, rgba(156, 153, 106, 1) 100%, rgba(232, 230, 181, 1) 100%);
    }
}

.field-container {
    .container {
        .name-text {
            // font-size: 80px;
            // font-weight: bold;
            // color: white;
            // text-align: center;
            // text-transform: uppercase;
            // font-family: impact;
            // -webkit-text-stroke-width: 2px;
            // -webkit-text-stroke-color: #2c2c2c;

            font-size: 64px;
            font-family: 'Luckiest Guy';
            color: #fff;
            -webkit-font-smoothing: antialiased;
            -moz-osx-font-smoothing: grayscale;
            text-shadow: 0px -6px 0 #212121,
                0px -6px 0 #212121,
                0px 6px 0 #212121,
                0px 6px 0 #212121,
                -6px 0px 0 #212121,
                6px 0px 0 #212121,
                -6px 0px 0 #212121,
                6px 0px 0 #212121,
                -6px -6px 0 #212121,
                6px -6px 0 #212121,
                -6px 6px 0 #212121,
                6px 6px 0 #212121,
                -6px 18px 0 #212121,
                0px 18px 0 #212121,
                6px 18px 0 #212121,
                0 19px 1px rgba(0, 0, 0, .1),
                0 0 6px rgba(0, 0, 0, .1),
                0 6px 3px rgba(0, 0, 0, .3),
                0 12px 6px rgba(0, 0, 0, .2),
                0 18px 18px rgba(0, 0, 0, .25),
                0 24px 24px rgba(0, 0, 0, .2),
                0 36px 36px rgba(0, 0, 0, .15);
        }
    }
}

.field-container {
    .container {
        width: 430px;
        height: 200px;
    }

    .list {
        height: 100%;
        display: flex;
        justify-content: center;
        flex-direction: column;

        .item {
            display: flex;
            align-items: center;
            margin-bottom: 6px;
            font-size: 24px;
            width: 100%;

            .profession {
                flex-grow: 1;
            }

            .level {
                position: relative;
                height: 42px;
                width: 42px;
                display: flex;
                align-items: center;
                justify-content: center;
                border-radius: 50%;
                border: 4px solid #9C976A;
                margin-right: 12px;
                background: #FFFCE0;
                color: #FFFCE0;
                font-size: 26px;
                font-weight: bold;

                span {
                    z-index: 2;
                }

                ::before {
                    content: "";
                    background: #9C976A;
                    height: 100%;
                    width: 100%;
                    border: 2px solid #FFFCE0;
                    position: absolute;
                    border-radius: 50%;
                }
            }
        }
    }
}

.field-container {

    .textarea {
        background: transparent;
        width: 430px;
        height: 370px;
        font-size: 20.5px;
        overflow: hidden;
    }
}

.field-container {
    width: 550px;
    height: 350px;

    .container {
        .list {
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            height: 100%;
            font-size: 24px;

            .level {
                color: inherit;
                margin-left: 4px;
            }
        }
    }
}

.field-container {
    width: 550px;
    height: 350px;
    .container {
        font-size: 20px;
        display: flex;
        flex-direction: column;
        justify-content: space-between;

        .trait {
            margin-bottom: 12px;

            .title {
                font-size: 24px;
                font-weight: bold;
            }
        }
    }
}

